import styles from './Project.scss';

const Project = ({
  title,
  subtitle,
  paragraph,
  image,
  subtitle2,
  paragraph2,
  image2,
  subtitle3,
  paragraph3,
  image3,
  subtitle4,
  paragraph4,
  image4
}) => {
  console.log(title);
  return (
    <div className={styles.wrapper}>
      <h3 className={styles.title}>{title}</h3>
      <p className={styles.paragraph}>{paragraph}</p>
      <img className={styles.image} src={image} alt=""></img>
    </div>
  );
};

export default Project;
